import './App.css';

function App() {
  return (
    <div className="App">

      {/* Main navbar */}
      <nav className="navbar h-navbar fixed-top bg-info main-hd">
      </nav>


      {/* Main container */}
      <div className="container-fluid">


        <div className="row">


          {/* COL 1 USER INFO AND PROFILE */}
          <div className="col-3 bg-danger">
            <div className="card position-fixed card-row">
              <img src="http://192.168.0.9:4000/user-1.png" className="card-img-top" alt="..."/>
              <div className="card-body">
                <h5 className="card-title">Profile Name</h5>
                <p className="card-text">Description Profile</p>
                <a href="#" className="btn btn-primary">Ver perfil</a>
              </div>
            </div>
          </div>  

          {/* COL 2 POSTS */}


        </div>


      </div>




    </div>
  );
}

export default App;
